Class providing granular controls on how loading screen is displayed when using  <mkapi-api-link nav="@nav/api/MainModule.install" semantic="function">install</mkapi-api-link> .

Here is an example:
 ```
import {LoadingScreenView, install} from '@youwol/webpm-client'

const loadingScreen = new LoadingScreenView({
    container: this,
    logo: `<div style='font-size:xxx-large'></div>`,
    wrapperStyle: {
        position: 'absolute', top: '0', left: '0', width: '100%', height: '100%', 'font-weight': 'bolder',
    },
})
loadingScreen.render()
await install({
    modules: ['rxjs#7'],
    onEvent: (ev) => {
        // event forwarding to loading screen
        loadingScreen.next(ev)
    },
})
// loadingScreen.next(...) can be used later in the code
// At some point remove the loading screen
loadingScreen.done()
``` 

Default values of the display options are defined in  <mkapi-api-link nav="@nav/api/MainModule.DefaultLoadingScreenOptions" semantic="class">DefaultLoadingScreenOptions</mkapi-api-link> , it can be controlled by e.g.:
 ```
import {LoadingScreenView, DefaultLoadingScreenOptions} from '@youwol/webpm-client'
// for all LoadingScreenView instances:
LoadingScreenView.DefaultOptions = {
    ...new DefaultLoadingScreenOptions(),
    fadingTimeout: 0,
}
// for one LoadingScreenView instance (includes previously set 'fadingTimeout' to 0):
new cdnClient.LoadingScreenView({
    logo: `<div style='font-size:xxx-large'></div>`,
})
``` 

> For default display, setting  `displayLoadingScreen: true`  from InstallInputsDeprecated is enough:
> creation and management of  <mkapi-api-link nav="@nav/api/MainModule.LoadingScreenView" semantic="class">LoadingScreenView</mkapi-api-link>  will be automatic.

